import test from 'ava' ;
import { parse , stringify , pown } from "../../../../src/index.js" ;

const fmt = x => x.length <= 40 ? x : x.slice(0,19) + '..' + x.slice(-19);

function macro ( t , A , B , C ) {
    const a = parse( A ) ;
    const c = pown( a , B ) ;
    t.is( stringify( a ) , A ) ;
    t.is( stringify( c ) , C ) ;
}

macro.title = ( _ , A , B , C ) => `pown(${fmt(A)},${B}) = ${fmt(C)}` ;

